import React, { useState } from "react";

export default function CombinedForm({csrfToken}) {
    const [value, setValue] = useState("1");

const handleClick = (event) => {
    const value = event.target.value;
    if (value == "1"){
        setValue(value);
    }
    else if(value == "2"){
        setValue(value);
    }
    else if(value == "3"){
        setValue(value);
    }
};
if (value == '1'){
    return (
    <div>
    <button value="2"
    onClick={handleClick} className="btnstyle">Form2</button>
    <button value="3"
    onClick={handleClick} className="btnstyle">Form3</button>
    <a href="/" className="astyle"><i>Home</i></a>
    <Form1 csrfToken={csrfToken} />
    </div>
);
}
else if (value == '2'){
    return (
    <div>
    <button value="1"
    onClick={handleClick} className="btnstyle">Form1</button>
    <button value="3"
    onClick={handleClick} className="btnstyle">Form3</button>
    <a href="/" className="astyle"><i>Home</i></a>
    <Form2 csrfToken={csrfToken} />
    </div>
);
}
else if (value == '3'){
    return (
    <div>
    <button value="1"
    onClick={handleClick} className="btnstyle">Form1</button>
    <button value="2"
    onClick={handleClick} className="btnstyle">Form2</button>
    <a href="/" className="astyle"><i>Home</i></a>
    <Form3 csrfToken={csrfToken} />
    </div>
);
}
}
